import { Component } from 'react'
import io from "socket.io-client"

class App extends Component {
  constructor(props: any){
    super(props)
    this.state = {
          list: "",
          socket: io()
    }
  }

  componentDidMount() {
    this.setState({socket: io()})
    this.state.socket.on('now', data => {
      this.setState({
        list: data.message
      })
    })
  }

  render(){
    return (
        <div>
              Welcome to page!
              {this.state.list}
        </div>)
  }
}

export default App
